        api.get(`totitementcod/${datainicial}/${datafinal}/${combocodigosele8}/`).then(response => {
            setTabela9(response.data)
           
          
        })
    },[datainicial,datafinal, combocodigosele8]);

    
    {/* Tabela todos os códigos */}
